■商品説明<br>
ブラックダイヤのような輝きを放つブラックスピネルネックレスの登場です <br><br>

カットされたそれぞれの小さな石が光を乱反射させ、ブラックダイヤと見間違うほど光り輝きます。<br><br> 

パワーストーンのような効果も併せ持ち、スピネルの持つ活性力は生命エネルギーを高め、 <br><br>

日々の生活を張りのあるものにしてくれるようです。 <br><br>

スタイルに合わせてお選び頂きやすいよう、豊富なトップのバリエーションをご用意。 <br><br>

シンプルながら、胸元をこなれた雰囲気で飾ってくれるスピネルネックレスをこの機会に是非手に入れてみて下さい。
<br><br><br><br>


長さ：約44cm<br><br><!--4000円以上で送料無料iframe-->


