■商品説明<br>
レザーの質感に絶妙にマッチするトップがこなれた印象をプラスするネックレス <br><br>

ワイルドさとスタイリッシュさが混じり合い胸元をお洒落に演出してくれます <br><br>

インパクトを持ちつつ落ち着つきを見せてくれる仕上がりに… <br><br>

レザーの紐部分は付け外しがしやすいスライド式になっています <br><br>

様々なシーンで活躍してくれるデイリーコーデのアクセントとなってくれるアイテムです <br><br><!--4000円以上で送料無料iframe-->


